$( () => {
    $('[data-toggle="tooltip"]').tooltip();
    //selects
    let sel_etl = $('#sel_etl');
    let sel_dimension = $('#sel_dimension');
    let sel_medida = $('#sel_medida');
    let sel_operacion = $('#sel_operacion');
    let sel_dashboard = $('#sel_dashboard');
    //buttons
    let btn_chart_bar = $('#btn_chart_load');
    let btn_chart_line = $('#btn_chart_line');
    let btn_chart_pie = $('#btn_chart_pie');
    let btn_print_pdf = $('#btn_print_pdf');
    let btn_save_dashboard = $('#btn_save_dashboard');
    let btn_save_grafico = $('#btn_save_grafico');

    //canvas
    let barras = document.getElementById("myChart").getContext('2d');
    let mybar  = null;
    //input
    let titulo_grafico = $('#titulo_grafico');
    let datasetTitle = $('#datasetTitle');
    let text_description = $('#text_description');
    let form_save_grafico = $('#form_save_grafico');
    let type_graphic = '';
    //modal
    let modal_dashboard = $('#modal_dashboard');
    let modal_previa_pdf = $('#modal_previa_pdf');
    let pdf_view = $('#pdf_view');
    //variable
    let hour_now = null;
    //table
    let table_data_grafico = $('#table_data_grafico');



    //animacion de carga en la peticion xhr con axios
    NProgress.configure({ trickle: false, showSpinner: true, parent: '#panel_graficos' });
    //fin
    let AllDashboard = async () =>{
        const response = await axios.get('getAllDashboard');
        return response.data;
    };

    let getDescriptionDashboard = async (id) =>{
        const resp = await axios.get('getDescriptionDashboard/'+id);
        return resp.data;
    };


    sel_dashboard.select2({theme:"bootstrap",placeholder:'dashboard',allowClear: true,dropdownParent:modal_dashboard});

    AllDashboard().then(response =>{
        if (response.data !== null){
            sel_dashboard.find('option').remove();
            sel_dashboard.append('<option value="">dashboard</option>');
            $.each(response.data, function (index, value) {
                sel_dashboard.append('<option value='+value.id+'>'+value.name+'</option>');
            });
        }
    }).catch(error =>{
        toastr.error( 'error al obtener listado dashboard');
    });

    sel_dashboard.change( () => {

        if ( sel_dashboard.val() !==''){
            getDescriptionDashboard( sel_dashboard.val() ).then(response =>{
                if ( response !== ''){
                    text_description.val( response.description );
                }
            }).catch(error => {
                toastr.error( 'error al obtener description');
            });
        }
    });

    sel_etl.change( () => {
        let key = sel_etl.val()  !==''? sel_etl.val() :'-';
        GetColumnsEtl(key);
    });

    btn_chart_bar.click( (e) => {
       e.preventDefault();
        if ( ValidaCampos() ){
            getData( sel_etl.val(), sel_dimension.val(), sel_medida.val(), sel_operacion.val(), 'bar', titulo_grafico.val(), datasetTitle.val() ).then(response =>{
                if (mybar !=null){
                    mybar.destroy();
                }
                let datos = { labels:response.labels , datasets:response.datasets };
                type_graphic = response.type;
                mybar = new Chart(barras, {
                    type: type_graphic,
                    data: datos,
                    options: response.options
                });
            }).catch(error =>{
                console.log('error get bar :'+error);
                toastr.error( 'ocurrio un error al generar grafcio bar');
            });
        }else {
          toastr.warning('Campo requerido');
        }
    });

    btn_chart_line.click( (e) => {
        e.preventDefault();
        if ( ValidaCampos() ){
            getData( sel_etl.val(), sel_dimension.val(), sel_medida.val(), sel_operacion.val(), 'line', titulo_grafico.val(), datasetTitle.val() ).then(response =>{
                if (mybar !=null){
                    mybar.destroy();
                }
                //line chart data
                let data = { labels: response.labels, datasets: response.datasets };
                //create Chart class object
                type_graphic = response.type;
                mybar = new Chart(barras, {
                    type:type_graphic,
                    data: data,
                    options: response.options
                });
            }).catch(error => {
                toastr.error( 'ocurrio un error al generar grafcio line');
            });
        }else {
            toastr.warning('Campo requerido');
        }
    });

    btn_chart_pie.click( (e) => {
        e.preventDefault();
        if ( ValidaCampos() ){
            getData( sel_etl.val(), sel_dimension.val(), sel_medida.val(), sel_operacion.val(), 'pie', titulo_grafico.val(), datasetTitle.val() ).then(response =>{
                if (mybar !=null){
                    mybar.destroy();
                }
                let datos = { labels:response.labels , datasets:response.datasets };
                type_graphic = response.type;
                mybar = new Chart(barras, {
                    type: type_graphic,
                    data: datos,
                    options:response.options
                });
            }).catch(error =>{
                toastr.error( 'ocurrio un error al generar grafcio pie');
            });
            }else {
            toastr.warning('Campo requerido');
        }
    });

    btn_print_pdf.click( (e) => {
        e.preventDefault();

        let obj_pdf = new jsPDF('l', 'cm', 'letter');

        let width = obj_pdf.internal.pageSize.getWidth() - 8;
        let height = obj_pdf.internal.pageSize.getHeight() - 9.5;
        let logo_andean = "data:image/png;base64,";
        let url_base64 = document.getElementById("myChart").toDataURL("image/png");
        obj_pdf.addImage(logo_andean,'PNG',19,1,3.5,1.7,'logo','FAST');
        obj_pdf.addImage(url_base64,'PNG',3,4,width,height,'grafico','FAST');

        obj_pdf.setFontSize(12);
        obj_pdf.setFontStyle("bold");
        obj_pdf.text(3, 2,"Reporte Gráfico");
        //pie doc
        obj_pdf.setFontSize(9);
        obj_pdf.setFont("times");
        obj_pdf.setFontStyle("italic");
        obj_pdf.text(6, 20," Usuario: "+user_data.name);
        obj_pdf.text(20, 20,"Fecha / Hora: "+hour_now);
        pdf_view.attr('src', obj_pdf.output('datauristring') );
        modal_previa_pdf.modal('show');
        obj_pdf.deletePage();
    });

    btn_save_dashboard.click((e) =>{
         e.preventDefault();
         if ( ValidaCampos() ){
             modal_dashboard.modal('show');
         }else {
            toastr.warning('Seleccione datos');
         }

     });

    btn_save_grafico.click( (e) =>{
        e.preventDefault();
        if ( ( ValidaCampos() ) && (sel_dashboard.val() !=='') ){
             saveGrafico().then(response =>{
                    if (response === 'store' ) {
                        toastr.success('agregado correctamente');
                        sel_dashboard.val('').trigger('change');
                        form_save_grafico[0].reset();
                    }else {
                        toastr.error('no se pudo agregar' + response);
                    }
             }).catch(error =>{
                    console.log(error);
             });
        }
    });

    modal_dashboard.on('hidden.bs.modal', (e) => {
        e.preventDefault();
        sel_dashboard.val('').trigger('change');
        form_save_grafico[0].reset();
    });

    function GetColumnsEtl(key) {
        axios.get('Bar/'+key.trim()+'/COLUMNS')
            .then(function (response) {
                if(response.status === 200){
                    SetColumnsCombo(sel_dimension,response.data.columns);
                    SetColumnsCombo(sel_medida,response.data.columns);
                }
            }).catch( error => {
               console.log('Error al obtener columnas'+error);
            });
    }

    function SetColumnsCombo(combo, options){
        combo.find('option').remove();
        combo.append('<option value="">seleecione</option>');
        $.each(options, function (index, value) {
            combo.append('<option value='+value+'>'+value+'</option>');
        });
    }

    let ValidaCampos = () => {
        if( sel_etl.val()  ==='' ){
            sel_etl.focus();
            return false;
        }else if ( sel_operacion.val() ==='') {
            sel_operacion.focus();
            return false;
        }else  if( sel_dimension.val()  ==='' ){
            sel_dimension.focus();
            return false;
        }else if(  sel_medida.val() === '' ) {
            sel_medida.focus();
            return false;
        }else if( titulo_grafico.val() === ''){
            titulo_grafico.focus();
            return false;
        }else if(datasetTitle.val() ===''){
            datasetTitle.focus();
            return false;
        }else {
            return true;
        }
    };

    let getData = async (collection,ejeY,ejeX,option,type,title,dataSetTitle) =>{
        let url =''+collection+'/'+ejeY+'/'+ejeX+'/'+option+'/'+type+'/'+title+'/'+dataSetTitle+'/getData';
        const resp = await axios.get(url);
        SetDataTable( resp.data.data_table );
        hour_now = JSON.parse( resp.data.grafico).hour;
        return  JSON.parse( resp.data.grafico );
    };

    let SetDataTable = (data) => {
        let title =  Object.keys( data[0] );
        let th = "<th>#</th>";
        let td = "";
        let tr = "";
        $.each(title, (i,value) =>{
            th += "<th>"+value+"</th>";
        });
        //add titles
        $('#th_data tr').remove();
        $('#th_data').append("<tr>"+th+"</tr>");
        //add rows
        $.each(Object.values(data) , (i,value) =>{
            td +=" <td>"+(i+1)+"</td>";
            $.each(value, (index, item) =>{
                td += " <td>"+item+"</td>";
            });
            tr +="<tr>"+td+"</tr>";
            td = "";
        });
        //add table rows
        $('#tb_data tr').remove();
        $('#tb_data').append(tr);
    };

    let saveGrafico = async () =>{
        const resp = await axios.post('store',{
                                key_data:sel_etl.val(),
                                operation:sel_operacion.val(),
                                dimension:sel_dimension.val(),
                                medida:sel_medida.val(),
                                title_graphic:titulo_grafico.val(),
                                title_dataset:datasetTitle.val(),
                                type:type_graphic,
                                dashboard_id:sel_dashboard.val()
                            });
        return resp.data;
    };

});